import React from 'react';
import '../../App.css';

class Pagers extends React.Component {

    updateSlide(i) {
        this.props.callbackParent(i); // hey parent, I've changed!
    }

    render() {

        //let self = this;

        return(
            <ul className = "pagers">
            { 
              this.props.items.map(function(m, index){
                   return <li key = {index} onClick = {this.updateSlide.bind(this, index)}></li> 
               }, this)}
            </ul>
        )
    }

}

export default Pagers;
